import React, { useRef } from "react";
import Element from "./Element";

const App = () => {
  const element1Ref = useRef(null);
  const element2Ref = useRef(null);

  return (
    <div>
      <Element content="Element 1" ref={element1Ref} end={true} delayed={true} />
      <Element content="Element 2" ref={element2Ref} start={true} />
    </div>
  );
};

export default App;
